import { memo, useState } from 'react'
import './ProfileLayout.scss'
import EditProfile from '../../images/editUser.png'
import Avatar1 from '../../images/avatar1.png'

function ProfileLayout() {
    const [avatar, setAvatar] = useState()

    return (
        <div className='container pd-profile'>
            <div className='d-flex mt-20 mb-20'>
                <div className='w-15 menu-profile'>
                    <img src={Avatar1} className='avatar-profile mb-50' />
                    <div className='w-100 option-menu-profile mb-20'><img src={EditProfile} className='icon-image-profile' /> Edit Profile</div>
                    <div className='w-100 option-menu-profile'>History Booking</div>
                </div>
                <div className='w-85'></div>
            </div>
        </div>
    )
}

export default memo(ProfileLayout)
